import React, { Component } from "react";
import LogIn from "../components/LogIn";

class UserLogIn extends Component {
  render() {
    return (
      <div className="UserLogIn">
        <button>
          <i className="glyphicon glyphicon-user" />
        </button>
      </div>
    );
  }
}

export default UserLogIn;
